/**
 * @param {string} s
 * @param {string} t
 * @return {string}
 */
var minWindow = function(s, t) {
    let index = [];
    const letterMap = new Map();
    for(const c of t){
        if(letterMap.has(c)){
            letterMap.set(c,letterMap.get(c)+1);
        } else {
            letterMap.set(c,1);
        }
    }
    //console.log(letterMap);
    let offset = 1;
    let first = false;
    for(let i = s.length-1;i>=0;i--){
        if(first){
            offset ++;
        }
        if(letterMap.has(s[i])){
            index.push({c:s[i],i,s:offset});
            first = true;
            offset = 0;
        }
    }
    index.reverse();
    let minResult = s.length+1;
    let result = "";
    for(let i = 0;i<index.length;i++){
        const tempMap = new Map(letterMap);
        let curResult = 0;
        for(let j = i;j<index.length;j++){
            const indexInfo = index[j];
            let num = tempMap.get(indexInfo.c);
            if(num && num > 1){
                tempMap.set(indexInfo.c,num-1)
            } else {
                tempMap.delete(indexInfo.c);
            }   
            if(tempMap.size == 0){
                curResult+=1;
                break;
            } else {
                curResult += indexInfo.s;
            }
            
        }
        if(tempMap.size > 0){
            break;
        }
        if(curResult < minResult){
            minResult = curResult;
            const start = index[i].i;
            result = s.substring(start,start+curResult);
            if(curResult == t.length){
                break;
            }
        }
    }
    return result;
};

console.log(minWindow("ADOBECODEBANC","ABC"));

console.log(minWindow("a","a"));

console.log(minWindow("a","aa"));

